import { ADD_FAVORITE_CHARACTER } from '../actions/type';

const initialState = {
 myFavorites: [],
}

const reducer = (state = initialState, actions) => {
 switch (actions.type) {
  case ADD_FAVORITE_CHARACTER:
   return {
    ...state,
   }
 }
}


export default reducer;
